var __index = {"config":{"lang":["en"],"separator":"[\\s\\-]+","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"Welcome to MkDocs","text":"<p>For full documentation visit mkdocs.org.</p>"},{"location":"index.html#commands","title":"Commands","text":"<ul> <li><code>mkdocs new [dir-name]</code> - Create a new project.</li> <li><code>mkdocs serve</code> - Start the live-reloading docs server.</li> <li><code>mkdocs build</code> - Build the documentation site.</li> <li><code>mkdocs -h</code> - Print help message and exit.</li> </ul>"},{"location":"index.html#project-layout","title":"Project layout","text":"<pre><code>mkdocs.yml    # The configuration file.\ndocs/\n    index.md  # The documentation homepage.\n    ...       # Other markdown pages, images and other files.\n</code></pre>"},{"location":"General_Notes/Cafemenu.html","title":"Cafe Menu","text":""},{"location":"General_Notes/Cafemenu.html#1-tags","title":"1. Tags","text":"<ul> <li>CSS (Cascading Style Sheets) by building a cafe menu. CSS is the language used to style an HTML document. It describes how HTML elements should be displayed on the screen.</li> <li>Every HTML document should have a DOCTYPE declaration and html element. The DOCTYPE tells the browser which version of HTML the document is in. And the html element represents the root element which contains all other elements.</li> </ul> <pre><code>&lt;!DOCTYPE html&gt;\n&lt;html lang=\"en\"&gt;\n&lt;!--all other elements go here--&gt;\n&lt;/html&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#2","title":"2","text":"<pre><code>&lt;head&gt; \n    &lt;title&gt; Cafe Menu &lt;/title&gt;\n&lt;/head&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#3","title":"3","text":"<ul> <li> <p>The title is one of several elements that provide extra information not visible on the web page, but it is useful for search engines or how the page gets displayed.</p> </li> <li> <p>Inside the head element, nest a meta element with an attribute named charset set to the value utf-8 to tell the browser how to encode characters for the page.</p> </li> </ul> <pre><code>&lt;head&gt;\n    &lt;title&gt;Cafe Menu&lt;/title&gt;\n    &lt;meta charset=\"utf-8\"&gt;\n&lt;/head&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#4","title":"4","text":"<pre><code>&lt;body&gt;\n&lt;/body&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#5","title":"5","text":"<pre><code>&lt;body&gt;\n&lt;main&gt;\n&lt;/main&gt;\n&lt;/body&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#6","title":"6","text":"<pre><code>&lt;body&gt;\n&lt;main&gt;\n    &lt;h1&gt; camper cafe &lt;/h1&gt;\n&lt;/main&gt;\n&lt;/body&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#7","title":"7","text":"<pre><code>&lt;h1&gt; camper cafe &lt;/h1&gt;\n&lt;p&gt; Est. 2020 &lt;p&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#8","title":"8","text":"<pre><code>&lt;main&gt;\n      &lt;h1&gt;CAMPER CAFE&lt;/h1&gt;\n      &lt;p&gt;Est. 2020&lt;/p&gt;\n      &lt;section&gt;\n        &lt;/section&gt;\n    &lt;/main&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#9","title":"9","text":"<pre><code>&lt;section&gt;\n    &lt;h2&gt; Coffee &lt;/h2&gt;\n&lt;/section&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#10","title":"10","text":"<ul> <li>added a style element to the head element</li> </ul> <pre><code>&lt;style&gt;\n&lt;/style&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#11","title":"11","text":"<ul> <li>You can add style to an element by specifying it in the style element and setting a property for it like this:</li> </ul> <pre><code>h1 {\n text-align: center;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#12","title":"12","text":"<p>-In the previous step, you used a type selector to style the h1 element. Center the content of the h2 and the p elements by adding a new type selector for each one to the existing style element.</p> <pre><code>p {\n text-align: center;\n}\n\nh2 {\n text-align: center;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#13","title":"13","text":"<ul> <li>You now have three type selectors with the exact same styling. You can add the same group of styles to many elements by creating a list of selectors. Each selector is separated with commas like this:</li> </ul> <p>p,h1,h2 {  text-align: center; }</p> <ul> <li>Delete the three existing type selectors and replace them with one selector list that centers the text for the h1, h2, and p elements.</li> </ul>"},{"location":"General_Notes/Cafemenu.html#14","title":"14","text":"<ul> <li>This works, but since there will be many more styles, it's best to put all the styles in a separate file and link to it.</li> </ul>"},{"location":"General_Notes/Cafemenu.html#15","title":"15","text":"<ul> <li>removed style content to later link the style sheet</li> </ul>"},{"location":"General_Notes/Cafemenu.html#16","title":"16","text":"<ul> <li>Inside the head element, add a link element. Give it a rel attribute with the value of \"stylesheet\" and a href attribute with the value of \"styles.css\".</li> </ul> <pre><code>&lt;link rel=\"stylesheet\" href=\"styles.css\"&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#17","title":"17","text":"<ul> <li> <p>For the styling of the page to look similar on mobile as it does on a desktop or laptop, you need to add a meta element with a special content attribute.</p> </li> <li> <p>Add the following within the head element:</p> </li> </ul> <pre><code>&lt;meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" /&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#18","title":"18","text":"<ul> <li>Add another style to the file that changes the background-color property to brown for the body element.</li> </ul> <pre><code>body {\n  background-color: brown;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#19","title":"19","text":"<pre><code>body {\n  background-color: burlywood;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#20","title":"20","text":"<ul> <li> <p>The div element is used mainly for design layout purposes unlike the other content elements you have used so far. Add a div element inside the body element and then move all the other elements inside the new div.</p> </li> <li> <p>Inside the opening div tag, add the id attribute with a value of menu.</p> </li> </ul> <pre><code>&lt;div id=\"menu\"&gt;\n&lt;/div&gt;\n ```\n\n## 21\n\n- You can use the id selector to target a specific element with an id attribute. An id selector is defined by placing the hash symbol # directly in front of the element's id value. For example, if an element has the id of cat then you would target that element like this:\n\n- Example Code\n- #cat {\n  - width: 250px;\n- }\n- Use the #menu selector to give your element a width of 300px.\n\n```html\n#menu {\n  width: 300px;\n}\n ```\n\n## 22\n\n```html\n/* background-color: burlywood; */\n ```\n\n## 23\n\n```html\n#menu {\n  background-color: burlywood;\n  width: 300px;\n}\n ```\n\n## 24\n\n- Now it's easy to see that the text is centered inside the #menu element. Currently, the width of the #menu element is specified in pixels (px).\n\n- Change the width property's value to be 80%, to make it 80% the width of its parent element (body).\n\n```html\n#menu {\n  width: 80%;\n  background-color: burlywood;\n}\n ```\n\n## 25\n\n- Next, you want to center the #menu horizontally. You can do this by setting its margin-left and margin-right properties to auto. Think of the margin as invisible space around an element. Using these two margin properties, center the #menu element within the body element.\n\n```html\n#menu {\n  width: 80%;\n  background-color: burlywood;\n  margin-left: auto;\n  margin-right: auto;\n}\n ```\n\n## 26\n\n- So far you have been using type and id selectors to style elements. However, it is more common to use a different selector to style your elements.\n\nA class selector is defined by a name with a dot directly in front of it, like this:\n\nExample Code\n.class-name {\n  styles\n}\nChange the existing #menu selector into a class selector by replacing #menu with a class named .menu.\n\n```html\n.menu {\n  width: 80%;\n  background-color: burlywood;\n  margin-left: auto;\n  margin-right: auto;\n}\n ```\n\n## 27\n\n- To apply the class's styling to the div element, remove the id attribute and add a class attribute to the div element's opening tag. Make sure to set the class value to menu.\n\n```html\n &lt;div class=\"menu\"&gt;\n ```\n\n## 28\n\n```html\n&lt;!-- added an image in the body element --&gt;\n body {\n  background-image:url(https://cdn.freecodecamp.org/curriculum/css-cafe/beans.jpg);\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#29","title":"29","text":"<ul> <li>Time to start adding some menu items. Add an empty article element under the Coffee heading. It will contain a flavor and price of each coffee you currently offer.</li> </ul> <pre><code>&lt;article&gt;&lt;/article&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#30","title":"30","text":"<ul> <li>article elements commonly contain multiple elements that have related information. In this case, it will contain a coffee flavor and a price for that flavor. Nest two p elements inside your article element. The first one's text should be French Vanilla, and the second's text 3.00.</li> </ul> <pre><code>&lt;article&gt;\n            &lt;p&gt; French Vanilla &lt;/p&gt;\n            &lt;p&gt; 3.00 &lt;/p&gt;\n          &lt;/article&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#31","title":"31","text":"<pre><code>&lt;!-- added more articles to include more coffee price pairs --&gt;\n &lt;article&gt;\n            &lt;p&gt;French Vanilla&lt;/p&gt;\n            &lt;p&gt;3.00&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article&gt;\n            &lt;p&gt;Caramel Macchiato&lt;/p&gt;\n            &lt;p&gt;3.75&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article&gt;\n            &lt;p&gt;Pumpkin Spice&lt;/p&gt;\n            &lt;p&gt;3.50&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article&gt;\n            &lt;p&gt;Hazelnut&lt;/p&gt;\n            &lt;p&gt;4.00&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article&gt;\n            &lt;p&gt;Mocha&lt;/p&gt;\n            &lt;p&gt;4.50&lt;/p&gt;\n          &lt;/article&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#32","title":"32","text":"<pre><code>&lt;!-- added class element to p tag to edit flavor to the left and price to the right --&gt;\n &lt;p class=\"flavor\"&gt;French Vanilla&lt;/p&gt;\n            &lt;p&gt;3.00&lt;/p&gt; \n</code></pre>"},{"location":"General_Notes/Cafemenu.html#33","title":"33","text":"<pre><code>&lt;!-- add class selector .flavor to text align flavor to the left --&gt;\n .flavor {\n  text-align: left;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#34","title":"34","text":"<pre><code>&lt;!-- added class element to p tag with the price to add class selector and have text align to the right --&gt;\n &lt;p class=\"price\"&gt;3.00&lt;/p&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#35","title":"35","text":"<pre><code>&lt;!-- added .price class selector --&gt;\n .price {\n  text-align:right;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#36","title":"36","text":"<pre><code>&lt;!-- start to inline both p tags so they are lined up on the same line in the menu as p tags are naturally block level elements --&gt;\n &lt;article class=\"item\"&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#37","title":"37","text":"<pre><code>&lt;!-- The p elements are nested in an article element with the class attribute of item. You can style all the p elements nested anywhere in elements with a class named item like this: --&gt;\n .item p {\n  display: inline-block;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#38","title":"38","text":"<pre><code>&lt;!-- That's closer, but the price didn't stay over on the right. This is because inline-block elements only take up the width of their content. To spread them out, add a width property to the flavor and price class selectors that have a value of 50% each. --&gt;\n .flavor {\n  width: 50%;\n  text-align: left;\n}\n\n.price {\n  width: 50%;\n  text-align: right;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#39","title":"39","text":"<pre><code>&lt;!--  Styling the p elements as inline-block and placing them on separate lines in the code creates an extra space to the right of the first p element, causing the second one to shift to the next line. One way to fix this is to make each p element's width a little less than 50%. --&gt;\n .flavor {\n  text-align: left;\n  width: 49%;\n}\n\n.price {\n  text-align: right;\n  width: 49%;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#40","title":"40","text":"<pre><code>&lt;!-- put the p elements on the same line in the editor --&gt;\n &lt;p class=\"flavor\"&gt;French Vanilla&lt;/p&gt;&lt;p class=\"price\"&gt;3.00&lt;/p&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#41","title":"41","text":"<pre><code>&lt;!-- changed width back to 50% in the class selectors again, now there is no space from the flavor or price on the menu --&gt;\n .flavor {\n  text-align: left;\n  width: 50%;\n}\n\n.price {\n  text-align: right;\n  width: 50%;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#42","title":"42","text":"<pre><code>&lt;!-- added the class item to the rest of the articles with a flavor and price --&gt;\n &lt;article class=\"item\"&gt;\n            &lt;p&gt;Caramel Macchiato&lt;/p&gt;\n            &lt;p&gt;3.75&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article class=\"item\"&gt;\n            &lt;p&gt;Pumpkin Spice&lt;/p&gt;\n            &lt;p&gt;3.50&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article class=\"item\"&gt;\n            &lt;p&gt;Hazelnut&lt;/p&gt;\n            &lt;p&gt;4.00&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article class=\"item\"&gt;\n            &lt;p&gt;Mocha&lt;/p&gt;\n            &lt;p&gt;4.50&lt;/p&gt;\n          &lt;/article&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#43","title":"43","text":"<pre><code>&lt;!-- put the other p elements on the same line so there is no space when they are on the sides --&gt;\n &lt;article class=\"item\"&gt;\n            &lt;p&gt;Caramel Macchiato&lt;/p&gt;&lt;p&gt;3.75&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article class=\"item\"&gt;\n            &lt;p&gt;Pumpkin Spice&lt;/p&gt;&lt;p&gt;3.50&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article class=\"item\"&gt;\n            &lt;p&gt;Hazelnut&lt;/p&gt;&lt;p&gt;4.00&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article class=\"item\"&gt;\n            &lt;p&gt;Mocha&lt;/p&gt;&lt;p&gt;4.50&lt;/p&gt;\n          &lt;/article&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#44","title":"44","text":"<pre><code>&lt;!-- added the class elements to each respective flavor and price to add style --&gt;\n &lt;article class=\"item\"&gt;\n            &lt;p class=\"flavor\"&gt;Caramel Macchiato&lt;/p&gt;&lt;p class=\"price\"&gt;3.75&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article class=\"item\"&gt;\n            &lt;p class=\"flavor\"&gt;Pumpkin Spice&lt;/p&gt;&lt;p class=\"price\"&gt;3.50&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article class=\"item\"&gt;\n            &lt;p class=\"flavor\"&gt;Hazelnut&lt;/p&gt;&lt;p class=\"price\"&gt;4.00&lt;/p&gt;\n          &lt;/article&gt;\n          &lt;article class=\"item\"&gt;\n            &lt;p class=\"flavor\"&gt;Mocha&lt;/p&gt;&lt;p class=\"price\"&gt;4.50&lt;/p&gt;\n          &lt;/article&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#45","title":"45","text":"<pre><code>&lt;!-- changed flavor width to 75% and price to 25% to wrap nicely --&gt;\n  .flavor {\n  text-align: left;\n  width: 75%;\n}\n\n.price {\n  text-align: right;\n  width: 25%;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#46","title":"46","text":"<pre><code>&lt;!-- added another section for desserts on the menu --&gt;\n  &lt;section&gt;&lt;/section&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#47","title":"47","text":"<pre><code>&lt;!-- added h2 element for desserts --&gt;\n  &lt;section&gt;\n          &lt;h2&gt; Desserts&lt;/h2&gt;\n        &lt;/section&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#48","title":"48","text":"<pre><code>&lt;!-- added empty article to display desserts and prices with class item --&gt;\n  &lt;h2&gt;Desserts&lt;/h2&gt;\n  &lt;article class=\"item\"&gt;&lt;/article\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#49","title":"49","text":"<pre><code>&lt;!-- added 2 p elements for dessert and price on the same line --&gt;\n  &lt;article class=\"item\"&gt;\n            &lt;p&gt;Donut&lt;/p&gt;&lt;p&gt;1.50&lt;/p&gt;\n          &lt;/article&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#50","title":"50","text":"<pre><code>&lt;!-- added a class for dessert and price in the respective p element --&gt;\n  &lt;p class=\"dessert\"&gt;Donut&lt;/p&gt;&lt;p class=\"price\"&gt;1.50&lt;/p&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#51","title":"51","text":"<pre><code>&lt;!-- added dessert as the additional selector with flavor to apply the same style --&gt;\n  .flavor, .dessert {\n  text-align: left;\n  width: 75%;\n}\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#52","title":"52","text":"<pre><code>&lt;!-- added a new fieldset element under the first one to add a new form --&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#53","title":"53","text":"<pre><code>&lt;!-- added a legend in the field set with text --&gt; \n</code></pre>"},{"location":"General_Notes/Cafemenu.html#54","title":"54","text":"<pre><code>&lt;!-- Forms commonly use checkboxes for questions that may have more than one answer. The input element with a type attribute set to checkbox creates a checkbox. --&gt; \n          &lt;input type=\"checkbox\"&gt; Loving\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#55","title":"55","text":"<pre><code>&lt;!-- added id attribute loving --&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#56","title":"56","text":"<pre><code>&lt;!-- There's another way to associate an input element's text with the element itself. You can nest the text within a label element and add a for attribute with the same value as the input element's id attribute.\n\nGiven an input element as below:\n\nExample Code\n&lt;input id=\"breakfast\" type=\"radio\" name=\"meal\" value=\"breakfast\"&gt;\nAn example of a label element that is associated to this input element is:\n\nExample Code\n&lt;label for=\"breakfast\"&gt;Breakfast&lt;/label&gt; --&gt;\n\n&lt;input id=\"loving\" type=\"checkbox\"&gt; &lt;label for=\"loving\"&gt;Loving&lt;/label&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#57","title":"57","text":"<pre><code>&lt;!-- added attribute name to input tag with value personality --&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#58","title":"58","text":"<pre><code>&lt;!-- added another input tag for a new checkbox for lazy, with the same name value personality but different id and for attribute values --&gt;\n</code></pre>"},{"location":"General_Notes/Cafemenu.html#59","title":"59","text":"<p>```html</p> <p>```</p>"},{"location":"General_Notes/Cafemenu.html#60","title":"60","text":"<p>```html</p> <p>```</p>"},{"location":"General_Notes/Cafemenu.html#61","title":"61","text":"<p>```html</p> <p> Loving</p> <p>```</p>"},{"location":"General_Notes/Cafemenu.html#62","title":"62","text":"<p>```html</p> <p>```</p>"},{"location":"General_Notes/Cafemenu.html#63","title":"63","text":"<p>```html</p> <p> No Copyright - freeCodeCamp.org </p> <p>```</p>"},{"location":"General_Notes/Cafemenu.html#64","title":"64","text":""},{"location":"General_Notes/Cafemenu.html#65","title":"65","text":""},{"location":"General_Notes/Cafemenu.html#66","title":"66","text":""},{"location":"General_Notes/Cafemenu.html#67","title":"67","text":""},{"location":"General_Notes/Cafemenu.html#68","title":"68","text":""},{"location":"General_Notes/Cafemenu.html#69","title":"69","text":""},{"location":"General_Notes/Cafemenu.html#70","title":"70","text":""},{"location":"General_Notes/Cafemenu.html#71","title":"71","text":""},{"location":"General_Notes/Cafemenu.html#72","title":"72","text":""},{"location":"General_Notes/Cafemenu.html#73","title":"73","text":""},{"location":"General_Notes/Cafemenu.html#74","title":"74","text":""},{"location":"General_Notes/Cafemenu.html#75","title":"75","text":""},{"location":"General_Notes/Cafemenu.html#76","title":"76","text":""},{"location":"General_Notes/Cafemenu.html#77","title":"77","text":""},{"location":"General_Notes/Cafemenu.html#78","title":"78","text":""},{"location":"General_Notes/Cafemenu.html#79","title":"79","text":""},{"location":"General_Notes/Cafemenu.html#80","title":"80","text":""},{"location":"General_Notes/Cafemenu.html#81","title":"81","text":""},{"location":"General_Notes/Cafemenu.html#82","title":"82","text":""},{"location":"General_Notes/Cafemenu.html#83","title":"83","text":""},{"location":"General_Notes/Cafemenu.html#84","title":"84","text":""},{"location":"General_Notes/Cafemenu.html#85","title":"85","text":""},{"location":"General_Notes/Cafemenu.html#86","title":"86","text":""},{"location":"General_Notes/Cafemenu.html#87","title":"87","text":""},{"location":"General_Notes/Cafemenu.html#88","title":"88","text":""},{"location":"General_Notes/Cafemenu.html#89","title":"89","text":""},{"location":"General_Notes/Cafemenu.html#90","title":"90","text":""},{"location":"General_Notes/Cafemenu.html#91","title":"91","text":""},{"location":"General_Notes/CatPhotoApp.html","title":"Cat Photo APP","text":""},{"location":"General_Notes/CatPhotoApp.html#1-tags","title":"1. Tags","text":"<ul> <li>HTML has opening and closing tags</li> </ul> <pre><code>&lt;h1&gt; Hello world &lt;/h1&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#2","title":"2","text":"<pre><code>&lt;h1&gt; CatPhotoApp &lt;/h1&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#3","title":"3","text":"<pre><code>&lt;h2&gt; CatPhotoApp &lt;/h2&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#4","title":"4","text":"<pre><code>&lt;--! TODO: Remove h1 --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#5","title":"5","text":"<pre><code>&lt;main&gt;\n&lt;/main&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#6","title":"6","text":"<pre><code>&lt;h1&gt; hello world&lt;/h1&gt;\n&lt;p&gt; Some more important content..nesting&lt;/p&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#7","title":"7","text":"<pre><code>&lt;img&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#8","title":"8","text":"<pre><code>&lt;img src=\"https://cdn.freecodecamp.org/curriculum/cat-photo-app/relaxing-cat.jpg\"&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#9","title":"9","text":"<pre><code>&lt;img src=\"cat.jpg\" alt=\"A cat\"&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#10","title":"10","text":"<pre><code>&lt;a href=\"https://www.freecodecamp.org\"&gt;&lt;/a&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#11","title":"11","text":"<pre><code>&lt;a href=\"https://www.freecodecamp.org\"&gt;click here to go to freeCodeCamp.org&lt;/a&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#12","title":"12","text":"<pre><code>&lt;p&gt;I think &lt;a href=\"https://www.freecodecamp.org\"&gt;freeCodeCamp&lt;/a&gt; is great.&lt;/p&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#13","title":"13","text":""},{"location":"General_Notes/CatPhotoApp.html#14","title":"14","text":"<pre><code>&lt;a href=\"https://www.freecodecamp.org\" target=\"_blank\"&gt;freeCodeCamp&lt;/a&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#15","title":"15","text":"<pre><code>&lt;a href=\"example-link\"&gt;\n  &lt;img src=\"image-link.jpg\" alt=\"A photo of a cat.\"&gt;\n&lt;/a&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#16","title":"16","text":"<pre><code>&lt;section&gt;\n&lt;/section&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#17","title":"17","text":"<pre><code>&lt;!-- add new sections to organzie page elements --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#18","title":"18","text":"<pre><code>&lt;section&gt;\n&lt;h2&gt; Cat lists &lt;/h2&gt;\n&lt;/section&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#19","title":"19","text":"<pre><code>&lt;!-- when using a lower heading element, it is implied you are starting a new subsection --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#20","title":"20","text":"<pre><code>&lt;!-- to create an unordered list, use the &lt;ul&gt; &lt;/ul&gt; Tags --&gt;\n ```\n\n## 21\n\n```html\n&lt;!-- to create a item in your unordered or ordered list, use &lt;li&gt; &lt;/li&gt; Tags --&gt;\n ```\n\n## 22\n\n```html\n&lt;img src=\"https://cdn.freecodecamp.org/curriculum/cat-photo-app/lasagna.jpg\" alt=\"A slice   of lasagna on a plate.\"&gt;\n ```\n\n## 23\n\n```html\n&lt;!-- The figure element represents self-contained content and will allow you to associate an image with a caption. --&gt;\n\n &lt;figure&gt;\n\n&lt;/figure&gt;\n ```\n\n## 24\n\n```html\n&lt;figure&gt;\n          &lt;img src=\"https://cdn.freecodecamp.org/curriculum/cat-photo-app/lasagna.jpg\" alt=\"A slice of lasagna on a plate.\"&gt;\n          &lt;figcaption&gt; Cats love lasagna &lt;/figcaption&gt;\n        &lt;/figure&gt;\n ```\n\n## 25\n\n```html\n&lt;!-- To place emphasis on a specific word or phrase, you can use the em element. --&gt;\n&lt;figcaption&gt;Cats &lt;em&gt;love&lt;/em&gt; lasagna.&lt;/figcaption&gt;\n ```\n\n## 26\n\n```html\n&lt;h3&gt; Top 3 things cats hate: &lt;/h3&gt;\n ```\n\n## 27\n\n```html\n&lt;!-- The code for an ordered list (ol) is similar to an unordered list, but list items in an ordered list are numbered when displayed. --&gt;\n &lt;ol&gt;\n            &lt;li&gt;flea treatment&lt;/li&gt;\n            &lt;li&gt;thunder&lt;/li&gt;\n            &lt;li&gt;other cats&lt;/li&gt;\n        &lt;/ol&gt;\n ```\n\n## 28\n\n```html\n&lt;!-- added another figure elemet --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#29","title":"29","text":"<pre><code>&lt;!-- added nested img elemtn with src attribute in the figure element --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#30","title":"30","text":"<pre><code>&lt;!-- added a alt attribute to the img element --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#31","title":"31","text":"<pre><code>&lt;!-- added a fig caption after the img element --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#32","title":"32","text":"<pre><code>&lt;!-- The strong element is used to indicate that some text is of strong importance or urgent. --&gt;\n &lt;figcaption&gt;Cats &lt;strong&gt;hate&lt;/strong&gt; other cats.&lt;/figcaption&gt; \n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#33","title":"33","text":"<pre><code>&lt;!-- added another section for our 3rd section --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#34","title":"34","text":"<pre><code>&lt;!-- added another h2 element in the 3rd section --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#35","title":"35","text":"<pre><code>&lt;!-- The form element is used to get information from a user like their name, email, and other details. --&gt;\n &lt;form&gt; &lt;/form&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#36","title":"36","text":"<pre><code>&lt;!-- The action attribute indicates where form data should be sent. --&gt;\n &lt;form action=\"https://freecatphotoapp.com/submit-cat-photo\"&gt;\n        &lt;/form&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#37","title":"37","text":"<pre><code>&lt;!-- The input element allows you several ways to collect data from a web form. Like img elements, input elements are a void element and do not need closing tags. --&gt;\n &lt;input&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#38","title":"38","text":"<pre><code>&lt;!-- added text to type attribute to allow user input --&gt;\n &lt;input type=\"text\"&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#39","title":"39","text":"<pre><code>&lt;!-- In order for a form's data to be accessed by the location specified in the action attribute, you must give the text field a name attribute and assign it a value to represent the data being submitted. --&gt;\n &lt;input type=\"text\" name=\"catphotourl\"&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#40","title":"40","text":"<pre><code>&lt;!-- Placeholder text is used to give people a hint about what kind of information to enter into an input.\n\nHere is an example of an input element with a placeholder set to Ex. Jane Doe: --&gt;\n &lt;input type=\"text\" name=\"catphotourl\" placeholder=\"cat photo URL\"&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#41","title":"41","text":"<pre><code>&lt;!-- To prevent a user from submitting your form when required information is missing, you need to add the required attribute to an input element. There's no need to set a value to the required attribute. Instead, just add the word required to the input element, making sure there is space between it and other attributes. --&gt;\n &lt;input type=\"text\" name=\"catphotourl\" placeholder=\"cat photo URL\" required=\"\"&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#42","title":"42","text":"<pre><code>&lt;!-- The button element is used to create a clickable button. text between the button tags comes up on the button --&gt;\n &lt;button&gt; Submit &lt;/button&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#43","title":"43","text":"<pre><code>&lt;!-- Even though you added your button below the text input, they appear next to each other on the page. That's because both input and button elements are inline elements, which don't appear on new lines.\n\nThe button you added will submit the form by default. However, relying on default behavior may cause confusion. Add the type attribute with the value submit to the button to make it clear that it is a submit button. --&gt;\n &lt;button type=\"submit\"&gt;Submit&lt;/button&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#44","title":"44","text":"<pre><code>&lt;!-- You can use radio buttons for questions where you want only one answer out of multiple options.\n\nHere is an example of a radio button with the option of cat:\n\nExample Code\n&lt;input type=\"radio\"&gt; cat\nRemember that an input element is a void element. --&gt;\n &lt;input type=\"radio\"&gt; Indoor\n          &lt;input type=\"text\" name=\"catphotourl\" placeholder=\"cat photo URL\" required&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#45","title":"45","text":"<pre><code>&lt;!-- label elements are used to help associate the text for an input element with the input element itself (especially for assistive technologies like screen readers).\n\nHere is an example of a label element with a radio button:\n\nExample Code\n&lt;label&gt;&lt;input type=\"radio\"&gt; cat&lt;/label&gt; --&gt;\n  &lt;label&gt;&lt;input type=\"radio\"&gt; Indoor &lt;/label&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#46","title":"46","text":"<pre><code>&lt;!-- The id attribute is used to identify specific HTML elements. Each id attribute's value must be unique from all other id values for the entire page.\n\nHere is an example of an input element with an id attribute:\n\nExample Code\n&lt;input id=\"email\"&gt; --&gt;\n  &lt;label&gt;&lt;input type=\"radio\" id=\"indoor\"&gt; Indoor&lt;/label&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#47","title":"47","text":"<pre><code>&lt;!-- created another label radio as outdoor --&gt;\n  &lt;label&gt;&lt;input id=\"indoor\" type=\"radio\"&gt; Indoor&lt;/label&gt;\n  &lt;label&gt;&lt;input id=\"outdoor\" type=\"radio\"&gt; Outdoor&lt;/label&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#48","title":"48","text":"<pre><code>&lt;!-- Notice that both radio buttons can be selected at the same time. To make it so selecting one radio button automatically deselects the other, both buttons must have a name attribute with the same value.\n\nHere is an example of two radio buttons with the same name attribute:\n\nExample Code\n&lt;input type=\"radio\" name=\"meal\"&gt; Breakfast\n&lt;input type=\"radio\" name=\"meal\"&gt; Lunch --&gt;\n  &lt;label&gt;&lt;input id=\"indoor\" type=\"radio\" name=\"indoor-outdoor\"&gt; Indoor&lt;/label&gt;\n          &lt;label&gt;&lt;input id=\"outdoor\" type=\"radio\" name=\"indoor-outdoor\"&gt; Outdoor&lt;/label&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#49","title":"49","text":"<pre><code>&lt;!-- If you select the Indoor radio button and submit the form, the form data for the button is based on its name and value attributes. Since your radio buttons do not have a value attribute, the form data will include indoor-outdoor=on, which is not useful when you have multiple buttons.\n\nAdd a value attribute to both radio buttons. For convenience, set the button's value attribute to the same value as its id attribute. --&gt;\n  &lt;label&gt;&lt;input id=\"indoor\" type=\"radio\" name=\"indoor-outdoor\" value=\"indoor\"&gt; Indoor&lt;/label&gt;\n          &lt;label&gt;&lt;input id=\"outdoor\" type=\"radio\" name=\"indoor-outdoor\" value=\"outdoor\"&gt; Outdoor&lt;/label&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#50","title":"50","text":"<pre><code>&lt;!-- The fieldset element is used to group related inputs and labels together in a web form. fieldset elements are block-level elements, meaning that they appear on a new line. --&gt;\n  &lt;fieldset&gt;\n          &lt;label&gt;&lt;input id=\"indoor\" type=\"radio\" name=\"indoor-outdoor\" value=\"indoor\"&gt; Indoor&lt;/label&gt;\n          &lt;label&gt;&lt;input id=\"outdoor\" type=\"radio\" name=\"indoor-outdoor\" value=\"outdoor\"&gt; Outdoor&lt;/label&gt;\n        &lt;/fieldset&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#51","title":"51","text":"<pre><code>&lt;!-- The legend element acts as a caption for the content in the fieldset element. It gives users context about what they should enter into that part of the form.\n\nAdd a legend element with the text Is your cat an indoor or outdoor cat? above both of the radio buttons. --&gt;\n  &lt;fieldset&gt;\n            &lt;legend&gt; Is your cat an indoor or outdoor cat? &lt;/legend&gt;\n            &lt;label&gt;&lt;input id=\"indoor\" type=\"radio\" name=\"indoor-outdoor\" value=\"indoor\"&gt; Indoor&lt;/label&gt;\n            &lt;label&gt;&lt;input id=\"outdoor\" type=\"radio\" name=\"indoor-outdoor\" value=\"outdoor\"&gt; Outdoor&lt;/label&gt;\n          &lt;/fieldset&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#52","title":"52","text":"<pre><code>&lt;!-- added a new fieldset element under the first one to add a new form --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#53","title":"53","text":"<pre><code>&lt;!-- added a legend in the field set with text --&gt; \n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#54","title":"54","text":"<pre><code>&lt;!-- Forms commonly use checkboxes for questions that may have more than one answer. The input element with a type attribute set to checkbox creates a checkbox. --&gt; \n          &lt;input type=\"checkbox\"&gt; Loving\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#55","title":"55","text":"<pre><code>&lt;!-- added id attribute loving --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#56","title":"56","text":"<pre><code>&lt;!-- There's another way to associate an input element's text with the element itself. You can nest the text within a label element and add a for attribute with the same value as the input element's id attribute.\n\nGiven an input element as below:\n\nExample Code\n&lt;input id=\"breakfast\" type=\"radio\" name=\"meal\" value=\"breakfast\"&gt;\nAn example of a label element that is associated to this input element is:\n\nExample Code\n&lt;label for=\"breakfast\"&gt;Breakfast&lt;/label&gt; --&gt;\n\n&lt;input id=\"loving\" type=\"checkbox\"&gt; &lt;label for=\"loving\"&gt;Loving&lt;/label&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#57","title":"57","text":"<pre><code>&lt;!-- added attribute name to input tag with value personality --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#58","title":"58","text":"<pre><code>&lt;!-- added another input tag for a new checkbox for lazy, with the same name value personality but different id and for attribute values --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#59","title":"59","text":"<pre><code>&lt;!-- added another checkboc for energetic --&gt;\n\n ```\n\n## 60\n\n```html\n\n&lt;!-- added value attribute to each checkbox input element with its respective id value --&gt;\n\n ```\n\n## 61\n\n```html\n\n&lt;!-- added checked attribute after input tag to check radio and checkbox by default, only the first options --&gt;\n\n&lt;input checked id=\"loving\" type=\"checkbox\" name=\"personality\" value=\"loving\"&gt; &lt;label for=\"loving\"&gt;Loving&lt;/label&gt;\n\n ```\n\n## 62\n\n```html\n\n&lt;footer&gt;&lt;/footer&gt;\n\n ```\n\n## 63\n\n```html\n\n&lt;footer&gt;\n      &lt;p&gt; No Copyright - freeCodeCamp.org &lt;/p&gt;\n    &lt;/footer&gt;\n\n ```\n\n## 64\n\n```html\n  &lt;!-- added checked attribute after input tag to check radio and checkbox by default, only the first options --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#65","title":"65","text":"<pre><code>  &lt;!-- The head element is used to contain metadata about the document, such as its title, links to stylesheets, and scripts. Metadata is information about the page that isn't displayed directly on the page. located above the body element --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#66","title":"66","text":"<pre><code>&lt;!-- The head element is used to contain metadata about the document, such as its title, links to stylesheets, and scripts. Metadata is information about the page that isn't displayed directly on the page. located above the body element --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#67","title":"67","text":"<pre><code>&lt;!-- The title element determines what browsers show in the title bar or tab for the page. located inside the head element --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#68","title":"68","text":"<pre><code>&lt;!-- All pages should begin with &lt;!DOCTYPE html&gt;. This special string is known as a declaration and ensures the browser tries to meet industry-wide specifications.\n\n&lt;!DOCTYPE html&gt; tells browsers that the document is an HTML5 document which is the latest version of HTML.\n\nAdd this declaration as the first line of the code. --&gt;\n</code></pre>"},{"location":"General_Notes/CatPhotoApp.html#69","title":"69","text":"<pre><code>&lt;!-- You can set browser behavior by adding meta elements in the head. Here's an example:\n\nExample Code\n&lt;meta attribute=\"value\"&gt;\nInside the head element, nest a meta element with an attribute named charset. Set to the value to utf-8 which tells the browser how to encode characters for the page.\n\nNote that the meta element is a void element. --&gt;\n&lt;meta charset=\"utf-8\"&gt;\n</code></pre>"}]}